import React from 'react';
import backgroundImage from '../assets/background_Image.jpg'; // Remplacez le chemin par le chemin de votre image

function Section() {
  const divStyle = {
    backgroundImage: `url(${backgroundImage})`,
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    // Autres styles CSS si nécessaire
    width: '100%',
    height: '00px', // Ajustez la hauteur selon vos besoins
  };

  return (
    <div style={divStyle}>
      {/* Votre contenu à afficher par-dessus l'image de fond */}
      <h1>Contenu au-dessus de l'image de fond</h1>
      <p>Autres éléments...</p>
    </div>
  );
}

export default Section;
